    done both regionally and nationally. This data pertains to the West coast  states
    . Expenditures on trips by mode (for-hire, private boat, and shore) were collected
    for both residents and non-residents of each state, and annual expenditures on durable
    goods were collected by resident status. Expenditures were collected both as an
    add-on to the intercept, and a followup phone survey with those who completed the
